import React from 'react'

export default function expensesmall() {
    let content=props.expenses.map((expense,index) => {
        return (
            <div key={index}>
                <section className="content">
                    <div className="row">
                        <div className="col-3">
                            <h6 style={{fontSize:'17px',fontFamily:'Acme'}}>Date {expense.date}</h6>
                        </div>
                        <div className="col-9">
                            <h6 style={{color:'#25b0b9',fontFamily:'Acme',fontSize:'17px'}}>{expense.category}</h6>
                        </div>
                    </div>
                </section>
            </div>
        )
    })
    return (
        <div className="card">
            <div className="card-body">
                {content}
            </div>
        </div>
    )
}
